import './App.css';
import {scroll, banner1, banner2, banner3} from './assets/export'
import {Carousel} from './components/export'
import {BsGithub, BsTwitter } from 'react-icons/bs'

function App() {
  const slides = [
    {img: banner1},
    {img: banner2},
    {img: banner3}
  ]
  return (
    <>
      <div className='carousel-container'>
        <Carousel slides={slides}/>
      </div>
      <div>
        <div></div>
        <div>
          <h2>Gamify</h2>
          <p>864 Hours till launch</p>
          <div>

          </div>
        </div>
      </div> 

    </>
  );
}

export default App;
